import { useState } from "react";
import AddItem from "./components/AddItem";
import Header from "./components/Header";
import TreeList from "./components/TreeList";

function App() {
  const [toggleList, setToggle] = useState(false);

  const onToggle = (key) => {
    // if (toggleList === key) {
    //   setToggle(null);
    // }

    setToggle(!toggleList);
  };

  const parents = {
    test1: {},
    test2: {},
  };

  const dataList = fetch(`http//localhost:5000/list`);

  return (
    <div className="App">
      <Header />
      <AddItem parents={parents} />
      <TreeList data={dataList} onToggle={onToggle} toggleList={toggleList} />
    </div>
  );
}

export default App;
